    "necedah-national-wildlife-refuge-narrative-report-january-february-march-and-april-1955",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Necedah NWR outlines
    Refuge accomplishments from January through April of 1955. The report begins by
    summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, rodents, mammals, and raptors- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. Resource
    management is outlined; topics include fur harvesting and timber removal. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes Refuge visitors. N-R forms and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
